import React from "react";

const MyCart = () => {
  return (
    <div style={{ padding: "2rem" }}>
      <h2>My Cart</h2>
      <p>You have 2 items in your cart:</p>
      <ul>
        <li>Organic Cotton T-shirt - ₹499</li>
        <li>Hemp Tote Bag - ₹299</li>
      </ul>
      <p>Total: ₹798</p>
      <button>Proceed to Billing</button>
    </div>
  );
};

export default MyCart;
